import React from 'react';
import Card from './AboutUsCard';
import '../css/AboutUs.css';

import Picture from '../img/art_pic_blog.jpg';

const AboutUs = () => {
  return(
    <div class="container">
      <div class="row">
        <Card picture={Picture}/>
        <Card />
        <Card />
      </div>
    </div>
  );
}

export default AboutUs;
